import React, { useState } from "react";
import "./Author.css";
import Header from "../components/Header";
import Footer from "../components/Footer";

const books = [
  { id: 1, title: "달까지 가자", author: "장류진", tag: "중고거래", thumbnail: "/img" },
  { id: 2, title: "아몬드", author: "손원평", tag: "중고거래", thumbnail: "/images/book2.jpg" },
  { id: 3, title: "오늘밤 세계에서 이 사랑이 사라진다 해도", author: "이치조 미사키", tag: "중고거래", thumbnail: "/images/book3.jpg" },
  { id: 4, title: "돌이킬 수 없는 약속", author: "아카가와 쥰", tag: "중고거래", thumbnail: "/images/book4.jpg" },
  { id: 5, title: "1퍼센트 부자의 법칙", author: "가나다", tag: "중고거래", thumbnail: "/images/book5.jpg" },
  { id: 6, title: "바다가 들리는 영화제3", author: "마지다 소노코", tag: "중고거래", thumbnail: "/images/book6.jpg" },
  { id: 7, title: "시와 선택", author: "한정현", tag: "중고거래", thumbnail: "/images/book7.jpg" },
  { id: 8, title: "마지막 마음이 닿는 공중전화", author: "이수연", tag: "중고거래", thumbnail: "/images/book8.jpg" },
  { id: 9, title: "독고치킨과 백예이는 학교 싶어", author: "백예인", tag: "무료나눔", thumbnail: "/images/book9.jpg" },
  { id: 10, title: "너의 초록으로 다시", author: "나태주", tag: "중고거래", thumbnail: "/images/book10.jpg" },
  { id: 11, title: "달의거리 고백해결", author: "이이에", tag: "중고거래", thumbnail: "/images/book11.jpg" },
  { id: 12, title: "불완한 완벽", author: "김지연", tag: "중고거래", thumbnail: "/images/book12.jpg" },
];

const Author = () => {
  const [category, setCategory] = useState("교환");
  const [genre, setGenre] = useState("최신순");
  const [sort, setSort] = useState("최신순");

  const handleCategoryChange = (event) => setCategory(event.target.value);
  const handleGenreChange = (event) => setGenre(event.target.value);
  const handleSortChange = (event) => setSort(event.target.value);

  return (
    <div className="header">
      <Header />
      <div className="author-marketplace">
        <header>
          <h1>북적거래</h1>
          <div className="filters">
            <select value={category} onChange={handleCategoryChange} className="filter-select">
              <option value="교환">교환</option>
              <option value="중고거래">중고거래</option>
              <option value="무료나눔">무료나눔</option>
            </select>
            <select value={genre} onChange={handleGenreChange} className="filter-select">
              <option value="소설">소설</option>
              <option value="에세이">에세이</option>
              <option value="만화">만화</option>
              <option value="전공서적">전공서적</option>
            </select>
            <select value={sort} onChange={handleSortChange} className="filter-select">
              <option value="최신순">최신순</option>
              <option value="인기순">인기순</option>
              <option value="낮은 가격순">낮은 가격순</option>
            </select>
          </div>
          <input type="text" placeholder="검색하기" className="search-bar" />
        </header>
        <div className="books-grid">
          {books.map((book) => (
            <div key={book.id} className="book-card">
              <img
                src={book.thumbnail}
                alt={book.title}
                className="book-thumbnail"
              />
              <h3>{book.title}</h3>
              <p>{book.author}</p>
              <span className={`tag ${book.tag === "무료나눔" ? "free" : "used"}`}>
                {book.tag}
              </span>
            </div>
          ))}
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Author;
